var side = 10.5

var grassArr = [];
var grassEaterArr = [];
var spiceArr = [];
var omnivorousArr = [];
var harvesterArr = [];

function gen() {
	// alert("Game of life. Rules and creatures: ")
	// alert("Grass: only multiplies")
	// alert("Grass eater: eats only grass; can multiply; moves and dies")
	// alert("Spice: multiplies slowly; can spawn grass with 50% chance; only harvesters can eat spice")
	// alert("Omnivorous: can eat grass and grass eaters, but can't eat other omnivorouses")
	// alert("Harvester: has a light blue tail; eats only spice and can't die; can spawn omnivorous, when eats 10 spices; if harvester is blocked by grass, it spawns a grass eater on random grass cell; can't multiply")

	grassCount = parseInt(prompt("Enter grass cells count: "))
	grassEatersCount = parseInt(prompt("Enter grass eaters count: "))
	spiceCount = parseInt(prompt("Enter spice count: "))
	omnivorousCount = parseInt(prompt("Enter omnivorouses count: "))
	harvestersCount = parseInt(prompt("Enter harvester machines count: "))

	for (let i = 0; i < grassCount; i++) {
		y = Math.round(Math.random() * 99)
		x = Math.round(Math.random() * 99)
		if (x >= 0 && x < matrix.length && y >= 0 && y < matrix.length) {
			new Grass(x, y)
		}
		
	}
	

	for (let i = 0; i < grassEatersCount; i++) {
		y = Math.round(Math.random() * 99)
		x = Math.round(Math.random() * 99)

		new GrassEater(x, y)
	}

	for (let i = 0; i < spiceCount; i++) {
		y = Math.round(Math.random() * 99)
		x = Math.round(Math.random() * 99)

		new Spice(x, y)
	}

	for (let i = 0; i < omnivorousCount; i++) {
		y = Math.round(Math.random() * 99)
		x = Math.round(Math.random() * 99)

		new Omnivorous(x, y)
	}

	for (let i = 0; i < harvestersCount; i++) {
		y = Math.round(Math.random() * 99)
		x = Math.round(Math.random() * 99)

		new Harvester(x, y)
	}
}

function setup() {
	frameRate(5)
	createCanvas(matrix[0].length * side, matrix.length * side)
	background(70, 70, 70)
	gen()
}

function draw() {
	for (var y = 0; y < matrix.length; y++) {
		for (var x = 0; x < matrix[y].length; x++) {
			if (matrix[y][x] == 0) {
				fill("grey")
			}
			else if (matrix[y][x] == 1) {
				fill("green")
			}
			else if (matrix[y][x] == 2) {
				fill("yellow")
			}
			else if (matrix[y][x] == 3) {
				fill("red")
			}
			else if (matrix[y][x] == 4) {
				fill(153, 51, 153)
			}
			else if (matrix[y][x] == 5) {
				fill(0, 102, 255)
			}
			else if (matrix[y][x] == 6) {
				fill(51, 153, 255)
			}
			stroke(70, 70, 70)
			rect(x * side, y * side, side, side, 4)
		}
	}
	for (let i = 0; i < grassArr.length; i++) {
		grassArr[i].mul()
	}
	for (let i = 0; i < grassEaterArr.length; i++) {
		grassEaterArr[i].eat()
	}
	for (let i = 0; i < spiceArr.length; i++) {
		spiceArr[i].mul()
	}
	for (let i = 0; i < omnivorousArr.length; i++) {
		omnivorousArr[i].eat()
	}
	for (let i = 0; i < harvesterArr.length; i++) {
		harvesterArr[i].eat()
	}
}